import React from 'react';
import './App.css'
import Header from './header';
import Home from './home';
import Coin from './coin';
import { BrowserRouter } from 'react-router-dom';

export default function App() {

  return (
        <BrowserRouter>
          <div className="App">
            <Header />
            <Home />
            <Coin />
        </div>
        </BrowserRouter>


  )
}
